import '../css/App.css';
import cloud from '../image/cloud.png';
import logo from '../image/logo.png';

function App() {
  return (
    <div className="App">
      <div className="cloud1"><img src={cloud} alt="cloud"  /></div>
      <div className="cloud2">  <img src={cloud} alt="cloud"  /></div>
      <div className="jfest"> 
      <table width='100%'>
        <tr></tr>
        <td><p >เทศกาล</p></td>
        <td><img src={logo} alt="cloud"  /></td>
        </table> 
        </div>
    </div>
  );
}

export default App;
